//@ts-nocheck

import React, { Component } from 'react'
import dynamic from 'next/dynamic'

const Map = dynamic(
    () => import('react-leaflet/lib/Map'),
    { ssr: false }
)
const Marker = dynamic(
    () => import('react-leaflet/lib/Marker'),
    { ssr: false }
)
const Popup = dynamic(
    () => import('react-leaflet/lib/Popup'),
    { ssr: false }
)
const TileLayer = dynamic(
    () => import('react-leaflet/lib/TileLayer'),
    { ssr: false }
)
const VideoOverlay = dynamic(
    () => import('react-leaflet/lib/VideoOverlay'),
    { ssr: false }
)

export default class VideoOverlayExample extends Component<
    {},
    { play: boolean },
    > {
    state = {
        play: true,
    }

    onTogglePlay = () => {
        this.setState({ play: !this.state.play })
    }

    render() {
        return (
            <Map center={[25, -100]} onClick={this.onTogglePlay} zoom={4}>
                <TileLayer
                    attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
                    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                />
                <VideoOverlay
                    bounds={[
                        [32, -130],
                        [13, -100],
                    ]}
                    play={this.state.play}
                    url="https://www.mapbox.com/bites/00188/patricia_nasa.webm"
                />
            </Map>
        )
    }
}
